import React from "react";
const styles = {
  root: {
    width: "100%",
    height: "100%",
    backgroundColor: "red",
  },
};
const Channels = ({ channels }) => {
  return (
    <div style={styles.root}>
      <List sx={{ width: "100%", maxWidth: 360, bgcolor: "background.paper" }}>
        <ListItem>
          <ListItemAvatar>
            <Avatar>
              <ImageIcon />
            </Avatar>
          </ListItemAvatar>
          <ListItemText primary="Photos" secondary="Jan 9, 2014" />
        </ListItem>
      </List>
    </div>
  );
};

export default Channels;
